=head1 DESCRIPTION

The rate limits for the URLs that you want to crawl. You should be
authorized to crawl the URLs.

=head1 ATTRIBUTES


=head2 MaxPages => Int

The max number of web pages crawled from your source URLs, up to 25,000
pages. If the web pages exceed this limit, the data source sync will
fail and no web pages will be ingested.


=head2 RateLimit => Int

The max rate at which pages are crawled, up to 300 per minute per host.



